import React from 'react';
// Importing the PDF file from the correct path (ensure this path points to the correct location)
import Resume from '/Users/shivaniuppe/Desktop/portfolio/public/Resume.pdf'; // Adjust the path if needed
import '/Users/shivaniuppe/Desktop/portfolio/src/Resume.css';

function ResumePage() {
    return (
        <>
            <h1>Resume</h1>
            {/* Display PDF inside an iframe */}
            <iframe
                src={Resume}  // Using the imported PDF file
                style={{ width: '100%', height: '800px', borderWidth: 0 }}
                title="Resume">
                Your browser does not support iframes.
            </iframe>
        </>
    );
}

export default ResumePage;
